import React, {Component } from 'react';
import logo from '../../logo.png'

export default class Timer extends Component {
    render() {
        return (
            <div className="">
                <img src={logo} className="tomato-logo" alt="logo" />
                <div id="stopwatch">
                    <h2>Session</h2>
                    <h1>00:00</h1>
                </div>
            </div>
        )
    }
}
